  \"digital-raster-graphicsd11b8\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\":
  \"A digital raster graphic (DRG) is a scanned image of a U.S. Geological Survey
  (USGS) topographic map. The scanned image includes all map collar information. The
  image inside the map neatline is georeferenced to the surface of the Earth. The
  DRG can be used to collect, review, and revise other digital data especially digital
  line graphs (DLG). When the DRG is combined with other digital products, such as
  digital orthophoto quadrangles (DOQ) or digital elevation models (DEM), the resulting
  image provides additional visual information for the extraction and revision of
  base cartographic information. The USGS is producing DRGs of the 1:24,000-, 1:25,000-,
  1:63,360- (Alaska), 1:100,000-, and 1:250,000-scale topographic map series.\",\n\t\"license_title\":
